import React from 'react';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import AddIcon from '@mui/icons-material/Add';

function Cart() {
  return (
    <div>
      <Row>
        <Card>
          <Card.Body>
            <h5 className="text-center">You have (3) items in your cart</h5>
            <div className="d-flex flex-column gap-1">
              <strong>Total: 37600.00</strong>
              <div>
                {' '}
                <Button variant="light" class><AddIcon/>Add payment method</Button>{' '}
              </div>
              <div>
                <Button variant='light'><AddIcon/>Add shipping</Button>{' '}
              </div>
            </div>
            <Row>
              <Col></Col>
            </Row>
          </Card.Body>
        </Card>
      </Row>
    </div>
  );
}

export default Cart;
